import React, { useState } from "react";
import './App.css';

function App() {
    const [message, setMessage] = useState("");
    const [question, setQuestion] = useState("");
    const [answer, setAnswer] = useState("");

    const loadData = async () => {
        try {
            const response = await fetch("http://127.0.0.1:8000/load_data", {
                method: "POST",
            });
            const result = await response.json();
            console.log(result);  // Log the full response to check for any issues
            setMessage(result.message);  // Show success or failure message
        } catch (error) {
            console.error("Error:", error);  // Log any errors that occur
            setMessage("Failed to update data. Please try again.");
        }
    };

    return (
        <div className="App">
            <button onClick={loadData}>Load Data into MongoDB</button>
            <p>{message}</p> {/* Display the message from the API response */}
        </div>
    );
}

export default App;
